import { useEffect, useState } from "react"
import { useParams } from "react-router-dom";

import CountryPage_Header from "../components/CountryPage_Header"

export default function CountryPage() {
    const {country, code} = useParams()
    const [countryInfo, setCountryInfo] = useState(null);

    useEffect(() => {
        fetch(`http://localhost:3000/api/getCountryInfo?code=${code}&country=${country}`)
        .then(response => {
            if(!response.ok) {
                throw new Error(response.status)
            }
        })
        .then(data => {
            console.log(data)
            setCountryInfo(
                <CountryPage_Header name={country} flag={data.flag} />
            )
        })
    }, [country, code])

    useEffect

    return (
        <>
            {countryInfo}
        </>
    );
}
